import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';

import Login from './components/Login/Login';
import PrivateRoute from './components/Login/PrivateRoute';
import Employee from './components/Employees/EmployeeDashboard';
import EmployeeNavbar from './components/Employees/EmployeeNavbar';
import EmployeeSidebar from './components/Employees/EmployeeSidebar';
import WorkOrders from './components/Employees/WorkOrders/WorkOrders';

function App() {
  return (
    <Router>
      <Route exact path='/login' component={ Login } />
      <Route path='/e_dashboard' component={ EmployeeNavbar } />
      <Route path='/e_dashboard' component={ EmployeeSidebar } />
      <Route exact path='/e_dashboard' component={ Employee } />
      <Route exact path='/e_dashboard/workorders' component={ WorkOrders } />
    </Router>
  );
}

export default App;
